import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import 'bootstrap/dist/css/bootstrap.min.css';
import Page from 'page';
import Header from "./Components/Header";
import Home from "./Components/Home";
import Profile from "./Components/Profile";
import Transaction from "./Components/Transaction";



function startHomeView(){
    ReactDOM.render(<Header/>,document.getElementById('header'));
    ReactDOM.render(<App/>,document.getElementById('root'));
}
function startProfileView(){
    ReactDOM.render(<Header/>,document.getElementById('header'));
    ReactDOM.render(<Profile/>,document.getElementById('root'));
}

function startTransactionView(context){
    var mode=context.params.mode
    ReactDOM.render(<Header/>,document.getElementById('header'));
    ReactDOM.render(<Transaction mode={mode}/>,document.getElementById('root'));
}
Page('/', startHomeView)
Page('/profile',startProfileView)
Page('/transaction/:mode',startTransactionView)
Page.start()


reportWebVitals();
